import React from 'react';
import classNames from 'classnames';
import {SectionProps} from '../../utils/SectionProps';
import Logo from "../layout/partials/Logo";
import Particule from "../elements/Particule";

const propTypes = {
  ...SectionProps.types
}

const defaultProps = {
  ...SectionProps.defaults
}

const Hero = ({
                className,
                topOuterDivider,
                bottomOuterDivider,
                topDivider,
                bottomDivider,
                hasBgColor,
                invertColor,
                ...props
              }) => {

  return (
     <section
        {...props}
     >
       <div className="mt-16">
         <div>
           <div className="tsparticles">
           <Particule/>
           </div>
           <div className="hero-full-screen">
             <Logo/>
             <div className="hero-title-logo">
               <h2 className="mt-0 mt-32">
                 Conseil, pilotage et <span className="text-color-primaryy">Développement IT</span>
               </h2>
             </div>
               <p className="m-0 mb-32">
                 Rise Consulting accélère la transformation digitale de ses clients en les accompagnant dans le
                 déploiement de projet IT complexes.
               </p>
           </div>
         </div>
       </div>
     </section>
  );
}

Hero.propTypes = propTypes;
Hero.defaultProps = defaultProps;

export default Hero;
